import SHOP_DATA from './data';
import { shopActiopnTypes } from './types';

const INITIAL_STATE = {
  collections: SHOP_DATA
};

const shopReducer = (state = INITIAL_STATE, action) => {
  switch (action.type) {
    case shopActiopnTypes.UPDATE_COLLECTIONS:
        return
    default:
      return state;
  }
};

export default shopReducer;
